import React from "react";

import { motion } from "framer";

import "./Logo.css";
import engranaje from "../../images/Logo/engranaje.png";
import manoDeSpock from "../../images/Logo/manoDeSpock.png";
import olivo from "../../images/Logo/olivo.png";
import cbIzquierdo from "../../images/Logo/cbIzquierdo.png";
import cbDerecho from "../../images/Logo/cvDerecho.png";

const Logo = () => {
  return (
    <div className="Logo row bg-info">
      <div className="col-12 logoImg">
        <motion.img
          className="img-fluid"
          src={engranaje}
          alt="engranaje de mi logo"
          animate={{ rotate: 720 }}
          transition={{ loop: Infinity, ease: "linear", duration: 90 }}
        />
        <motion.img
          className="logoImg"
          src={olivo}
          alt="mano de Spock"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 3, duration: 5 }}
        />
      </div>

      {/* <motion.img
        className="logoImg"
        src={cbIzquierdo}
        alt="mano de Spock"
        initial={{ x: -200, opacity: 0 }}
        animate={{ x: 0, opacity: 1 }}
        transition={{ delay: 5, duration: 5 }}
      />
      <motion.img
        className="logoImg"
        src={cbDerecho}
        alt="mano de Spock"
        initial={{ x: 200, opacity: 0 }}
        animate={{ x: 0, opacity: 1 }}
        transition={{ delay: 5, duration: 5 }}
      /> */}
    </div>
  );
};

export default Logo;
